import React, {useState} from "react";
//context api ile kullanılacak dataların tanımlanması

//grafik datası
export const BarDataContext = React.createContext()
//en büyük değer için tutulan data
export const BigBarDataContext = React.createContext()
//yılların değişmesi için tutulan data
export const YearDataContext = React.createContext();
const Store = ({children}) => {
    //use state ile ilk değerlerinin tanımlanması
    const [barData, setBarData] = useState([
        {
            id: 1,
            title: "VueJS",
            color: "#FFB719",
            value: 333,
            imageUri: "data:image/png;base64,"
        },
        {
            id: 2,
            title: "ReactJS",
            color: "#FF0080",
            value: 200,
            imageUri: "https://upload.wikimedia.org/wikipedia/commons/thumb/a/a7/React-icon.svg/1024px-React-icon.svg.png"
        },
        {
            id: 3,
            title: "Angular",
            color: "#00CAFF",
            value: 555,
            imageUri: "https://angular.io/assets/images/logos/angular/angular.svg"
        },
        {
            id: 6,
            title: "C#",
            color: "#5ADBE8",
            value: 1020,
            imageUri: "data:image/png;base64,"
        },
        {
            id: 7,
            title: "Java",
            color: "#EB9C1C",
            value: 699,
            imageUri: "data:image/png;base64,"
        },
        {
            id: 5,
            title: "Php",
            color: "#A500FF",
            value: 1012,
            imageUri: "data:image/png;base64,"
        },
        {
            id: 4,
            title: "NodeJS",
            color: "#D500FF",
            value: 700,
            imageUri: "data:image/png;base64,"

        }
    ]);
    //ilk değer ataması
    const [yearData, setYearData] = useState(2000);
    //verilen data içindeki en büyük değerin bulunması
    const findBiggesBarItem = (data) => {
        return data.sort((val1, val2) => val2.value - val1.value)[0].value
    }
    //en büyük değerin tutulmaso
    const [biggestBarData, setBiggestBardData] = useState(findBiggesBarItem(barData))
    return (
        <BarDataContext.Provider value={[barData, setBarData]}>
            <BigBarDataContext.Provider value={[biggestBarData, setBiggestBardData]}>

                <YearDataContext.Provider value={[yearData, setYearData]}>
                    {children}
                </YearDataContext.Provider>


            </BigBarDataContext.Provider>
        </BarDataContext.Provider>

    )
}
export default Store
